import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <footer className="Footer">
        <h4 className="names">
          <a href="https://www.linkedin.com/in/lauren-carne-306a2a13/">
            <img
              className="linkedin"
              src="https://i.imgur.com/3Qrizh4.png"
              alt="Linkedin Link"
            />
            Lauren Carne
          </a>
          &
          <a href="https://www.linkedin.com/in/miao-shan-a60b2621/">
            Miao Shan
            <img
              className="linkedin"
              src="https://i.imgur.com/3Qrizh4.png"
              alt="Linkedin Link"
            />
          </a>
        </h4>
        <h5 className="copyright"> &copy; Copyright 2019 Flatiron School </h5>
      </footer>
    );
  }
}

export default Footer;
